ControlPropertyState.AutoRuleBindingString:
Set(UltimoCadastro, Max(Assistências,'ID Pessoa'));

ClearCollect(
    MinhaColecaoDuplicada,
    ForAll(
        Sequence(UltimoCadastro),
        {
            Valor: Value,
            Duplicatas: Filter(
                Assistências,
                    'ID Pessoa' = Value)
        }
    )
);

ClearCollect(
    ValoresDuplicados,
    Filter(
        MinhaColecaoDuplicada,
        CountRows(Duplicatas) > 1
    )
);

